-1.png\",\"id\":158,\"alt\":\"\",\"source\":\"library\"},\"thumbnail_size\":\"thumbnail\",\"title_text\":\"Document Management System\",\"description_text\":\"A document management system (DMS) is a software application that helps businesses organize, store, and track electronic documents and images. DMS typically includes features such as version control, metadata, security, and workflow. It allows users to easily search and retrieve documents, while also maintaining a secure and auditable record of all document activity. Additionally, many DMS systems now include collaboration features that allow multiple users to work on the same document at the same time. Implementing a DMS can help businesses improve efficiency and compliance, while also reducing costs associated with paper storage.\",\"link\":{\"url\":\"systems.bayambang.gov.ph\",\"is_external\":\"on\",\"nofollow\":\"\",\"custom_attributes\":\"\"},\"title_size\":\"h5\",\"image_space\":{\"unit\":\"px\",\"size\":22,\"sizes\":[]},\"image_border_radius\":{\"unit\":\"px\",\"size\":0,\"sizes\":[]},\"background_hover_transition\":{\"unit\":\"px\",\"size\":0.1,\"sizes\":[]},\"text_align\":\"center\",\"title_bottom_space\":{\"unit\":\"px\",\"size\":8,\"sizes\":[]},\"title_typography_typography\":\"custom\",\"title_typography_font_family\":\"Roboto\",\"title_typography_font_size\":{\"unit\":\"px\",\"size\":25,\"sizes\":[]},\"title_typography_font_weight\":\"600\",\"description_typography_typography\":\"custom\",\"description_typography_font_family\":\"Roboto\",\"description_typography_font_size\":{\"unit\":\"px\",\"size\":11,\"sizes\":[]},\"description_typography_font_weight\":\"400\",\"description_typography_line_height\":{\"unit\":\"px\",\"size\":16,\"sizes\":[]},\"description_typography_letter_spacing\":{\"unit\":\"px\",\"size\":-0.3,\"sizes\":[]}},\"elements\":[],\"widgetType\":\"image-box\"}],\"isInner\":false},{\"id\":\"a1d3ff0\",\"elType\":\"column\",\"settings\":{\"_column_size\":33,\"_inline_size\":null},\"elements\":[{\"id\":\"30ff9b0\",\"elType\":\"widget\",\"settings\":{\"image\":{\"url\":\"http:\\/\\/localhost\\/bbwebsite\\/wp-content\\/uploads\\/2023\\/01\\/15437169-e1674541644428.jpg\",\"id\":162,\"alt\":\"\",\"source\":\"library\"},\"thumbnail_size\":\"thumbnail\",\"title_text\":\"Vaccination Management System\",\"description_text\":\"The Vaccination Management System is a cutting-edge solution designed to streamline the administration and tracking of vaccinations for individuals and groups. It utilizes a user-friendly interface that allows for easy data entry and access, as well as advanced features such as automated reminders and reporting capabilities. This system can be used by healthcare providers, schools, and other organizations to ensure that individuals are up-to-date on their vaccinations, reducing the risk of disease spread. With its ability to integrate with other systems and easily share data, the Vaccination Management System is a powerful tool for improving vaccination coverage and protecting public health.\",\"link\":{\"url\":\"https:\\/\\/systems.bayambang.gov.ph\\/vaccineregister?fbclid=IwAR1xpC1gDSLWB7GuRxpkwzAwlexX1HdQ8vdKx-JWRQpE9zEqqNGcUikjPXY\",\"is_external\":\"on\",\"nofollow\":\"\",\"custom_attributes\":\"\"},\"title_size\":\"h5\",\"image_space\":{\"unit\":\"px\",\"size\":22,\"sizes\":[]},\"image_border_radius\":{\"unit\":\"px\",\"size\":0,\"sizes\":[]},\"background_hover_transition\":{\"unit\":\"px\",\"size\":0.1,\"sizes\":[]},\"text_align\":\"center\",\"title_bottom_space\":{\"unit\":\"px\",\"size\":8,\"sizes\":[]},\"title_typography_typography\":\"custom\",\"title_typography_font_family\":\"Roboto\",\"title_typography_font_size\":{\"unit\":\"px\",\"size\":25,\"sizes\":[]},\"title_typography_font_weight\":\"600\",\"description_typography_typography\":\"custom\",\"description_typography_font_family\":\"Roboto\",\"description_typography_font_size\":{\"unit\":\"px\",\"size\":11,\"sizes\":[]},\"description_typography_font_weight\":\"400\",\"description_typography_line_height\":{\"unit\":\"px\",\"size\":16,\"sizes\":[]},\"description_typography_letter_spacing\":{\"unit\":\"px\",\"size\":-0.3,\"sizes\":[]}},\"elements\":[],\"widgetType\":\"image-box\"}],\"isInner\":false},{\"id\":\"1f1b59e\",\"elType\":\"column\",\"settings\":{\"_column_size\":33,\"_inline_size\":null},\"elements\":[{\"id\":\"322d6ff\",\"elType\":\"widget\",\"settings\":{\"image\":{\"url\":\"http:\\/\\/localhost\\/bbwebsite\\/wp-content\\/uploads\\/2023\\/01\\/ABSIconPNG-640w.png\",\"id\":164,\"alt\":\"\",\"source\":\"library\"},\"thumbnail_size\":\"thumbnail\",\"title_text\":\"Online Appointment System\",\"description_text\":\"An online appointment system is a software tool that allows businesses to manage and schedule appointments with clients or customers through the internet. This system streamlines the process of making appointments, eliminates the need for phone calls and walk-ins, and improves efficiency and communication between the business and its clients. It also allows for easy rescheduling and cancellations, and provides reminders for upcoming appointments. Overall, an online appointment system improves the customer experience and increases the productivity and organization of the business.\",\"link\":{\"url\":\"appoinment.bayambang.gov.ph\",\"is_external\":\"on\",\"nofollow\":\"\",\"custom_attributes\":\"\"},\"title_size\":\"h5\",\"image_space\":{\"unit\":\"px\",\"size\":22,\"sizes\":[]},\"image_border_radius\":{\"unit\":\"px\",\"size\":0,\"sizes\":[]},\"background_hover_transition\":{\"unit\":\"px\",\"size\":0.1,\"sizes\":[]},\"text_align\":\"center\",\"title_bottom_space\":{\"unit\":\"px\",\"size\":8,\"sizes\":[]},\"title_typography_typography\":\"custom\",\"title_typography_font_family\":\"Roboto\",\"title_typography_font_size\":{\"unit\":\"px\",\"size\":25,\"sizes\":[]},\"title_typography_font_weight\":\"600\",\"description_typography_typography\":\"custom\",\"description_typography_font_family\":\"Roboto\",\"descriptio