 Management System is a cutting-edge solution designed to streamline the administration and tracking of vaccinations for individuals and groups. It utilizes a user-friendly interface that allows for easy data entry and access, as well as advanced features such as automated reminders and reporting capabilities. This system can be used by healthcare providers, schools, and other organizations to ensure that individuals are up-to-date on their vaccinations, reducing the risk of disease spread. With its ability to integrate with other systems and easily share data, the Vaccination Management System is a powerful tool for improving vaccination coverage and protecting public health.\",\"link\":{\"url\":\"https:\\/\\/systems.bayambang.gov.ph\\/vaccineregister?fbclid=IwAR1xpC1gDSLWB7GuRxpkwzAwlexX1HdQ8vdKx-JWRQpE9zEqqNGcUikjPXY\",\"is_external\":\"on\",\"nofollow\":\"\",\"custom_attributes\":\"\"},\"title_size\":\"h5\",\"image_space\":{\"unit\":\"px\",\"size\":22,\"sizes\":[]},\"image_border_radius\":{\"unit\":\"px\",\"size\":0,\"sizes\":[]},\"background_hover_transition\":{\"unit\":\"px\",\"size\":0.1,\"sizes\":[]},\"text_align\":\"center\",\"title_bottom_space\":{\"unit\":\"px\",\"size\":8,\"sizes\":[]},\"title_typography_typography\":\"custom\",\"title_typography_font_family\":\"Roboto\",\"title_typography_font_size\":{\"unit\":\"px\",\"size\":25,\"sizes\":[]},\"title_typography_font_weight\":\"600\",\"description_typography_typography\":\"custom\",\"description_typography_font_family\":\"Roboto\",\"description_typography_font_size\":{\"unit\":\"px\",\"size\":11,\"sizes\":[]},\"description_typography_font_weight\":\"400\",\"description_typography_line_height\":{\"unit\":\"px\",\"size\":16,\"sizes\":[]},\"description_typography_letter_spacing\":{\"unit\":\"px\",\"size\":-0.3,\"sizes\":[]}},\"elements\":[],\"widgetType\":\"image-box\"}],\"isInner\":false},{\"id\":\"1f1b59e\",\"elType\":\"column\",\"settings\":{\"_column_size\":33,\"_inline_size\":null},\"elements\":[{\"id\