y_line_height\":{\"unit\":\"px\",\"size\":16,\"sizes\":[]},\"description_typography_letter_spacing\":{\"unit\":\"px\",\"size\":-0.3,\"sizes\":[]}},\"elements\":[],\"widgetType\":\"image-box\"}],\"isInner\":false},{\"id\":\"1f1b59e\",\"elType\":\"column\",\"settings\":{\"_column_size\":33,\"_inline_size\":null},\"elements\":[{\"id\":\"322d6ff\",\"elType\":\"widget\",\"settings\":{\"image\":{\"url\":\"http:\\/\\/localhost\\/bbwebsite\\/wp-content\\/uploads\\/2023\\/01\\/ABSIconPNG-640w.png\",\"id\":164,\"alt\":\"\",\"source\":\"library\"},\"thumbnail_size\":\"thumbnail\",\"title_text\":\"Online Appointment System\",\"description_text\":\"An online appointment system is a software tool that allows businesses to manage and schedule appointments with clients or customers through the internet. This system streamlines the process of making appointments, eliminates the need for phone calls and walk-ins, and improves efficiency and communication between the business and its clients. It also allows for easy rescheduling and cancellations, and provides reminders for upcoming appointments. Overall, an online appointment system improves the customer experience and increases the productivity and organization of the business.\",\"link\":{\"url\":\"appoinment.bayambang.gov.ph\",\"is_external\":\"on\",\"nofollow\":\"\",\"custom_attributes\":\"\"},\"title_size\":\"h5\",\"image_space\":{\"unit\":\"px\",\"size\":22,\"sizes\":[]},\"image_border_radius\":{\"unit\":\"px\",\"size\":0,\"sizes\":[]},\"background_hover_transition\":{\"unit\":\"px\",\"size\":0.1,\"sizes\":[]},\"text_align\":\"center\",\"title_bottom_space\":{\"unit\":\"px\",\"size\":8,\"sizes\":[]},\"title_typography_typography\":\"custom\",\"title_typography_font_family\":\"Roboto\",\"title_typography_font_size\":{\"unit\":\"px\",\"size\":25,\"sizes\":[]},\"title_typography_font_weight\":\"600\",\"description_typography_typography\":\"custom\",\"description_typography_font_family\":\"Roboto\",\"description_typography_font_siz