(83, 1, '2023-01-24 01:59:33', '2023-01-24 01:59:33', '<!-- wp:image {\"id\":85,\"sizeSlug\":\"full\",\"linkDestination\":\"none\",\"style\":{\"border\":{\"width\":\"6px\"}},\"className\":\"is-style-default\"} -->\n<figure class=\"wp-block-image size-full has-custom-border is-style-default\"><img src=\"http://localhost/bbwebsite/wp-content/uploads/2023/01/Sample-news-1.jpeg\" alt=\"\" class=\"wp-image-85\" style=\"border-width:6px\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Nakipagpulong ang mga Punong Barangay ng Bical Norte, Maigpa, Duera, Pugo, San Gabriel 2nd, Iton, Manambong Parte, Tambac, Paragos, at Darawey kay Mayor Niña Jose-Quiambao, Vice Mayor Ian Camille Sabangan, at mga myembro ng Sangguniang Bayan upang iparating ang kanilang pakikiisa sa adhikain ng administrasyong Quiambao-Sabangan sa Rebolusyon Laban sa Kahirapan.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Sa pagpupulong noong September 12, ipinarating ng sampung kapitan na katulad ng Team Quiambao-Sabangan ay hangad din nila ang mas magandang bayan ng Bayambang. Dahil dito, napagpasyahan nilang makiisa sa adhikain ng kasalukuyang administrasyon tungo sa tunay na pagkakaisa at tunay na progreso para sa bawat Bayambangueño.</p>\n<!-- /wp:paragraph -->', 'Sampung Kapitan mula sa Kabilang Partidong Politikal, Nakiisa na sa Team Quiambao-Sabangan', '', 'publish', 'open', 'open', '', 'sampung-kapitan-mula-sa-kabilang-partidong-politikal-nakiisa-na-sa-team-quiambao-sabangan', '', '', '2023-01-24 01:59:33', '2023-01-24 01:59:33', '', 0, 'http://localhost/bbwebsite/?p=83', 0, 'post', '', 0),
