or-image-box-img{margin:auto}.elementor-widget-image-box.elementor-vertical-align-top .elementor-image-box-wrapper{align-items:flex-start}.elementor-widget-image-box.elementor-vertical-align-middle .elementor-image-box-wrapper{align-items:center}.elementor-widget-image-box.elementor-vertical-align-bottom .elementor-image-box-wrapper{align-items:flex-end}}@media (max-width:767px){.elementor-widget-image-box .elementor-image-box-img{margin-left:auto!important;margin-right:auto!important;margin-bottom:15px}}.elementor-widget-image-box .elementor-image-box-img{display:inline-block}.elementor-widget-image-box .elementor-image-box-title a{color:inherit}.elementor-widget-image-box .elementor-image-box-wrapper{text-align:center}.elementor-widget-image-box .elementor-image-box-description{margin:0}</style><figure><img width=\"150\" height=\"150\" src=\"http://localhost/bbwebsite/wp-content/uploads/2023/01/pngwing.com-1-150x150.png\" alt=\"\" loading=\"lazy\" /></figure><h5>Document Management System</h5><p>A document management system (DMS) is a software application that helps businesses organize, store, and track electronic documents and images. DMS typically includes features such as version control, metadata, security, and workflow. It allows users to easily search and retrieve documents, while also maintaining a secure and auditable record of all document activity. Additionally, many DMS systems now include collaboration features that allow multiple users to work on the same document at the same time. Implementing a DMS can help businesses improve efficiency and compliance, while also reducing costs associated with paper storage.</p>		\n			<figure><a href=\"http://systems.bayambang.gov.ph\"><img width=\"150\" height=\"150\" src=\"http://localhost/bbwebsite/wp-content/uploads/2023/01/15437169-e1674541644428-150x150.jpg\" alt=\"\" loading=\"lazy\" /></a></figure><h5><a href=\"http://systems.bayambang.gov.ph\">Vaccination Management System</a></h5><p>The Vaccination Management System is a cutting-edge solution designed to streamline the administration and tracking of vaccinations for individuals and groups. It utilizes a user-friendly interface that allows for easy data entry and access, as well as advanced features such as automated reminders and reporting capabilities. This system can be used by healthcare providers, schools, and other organizations to ensure that individuals are up-to-date on their vaccinations, reducing the risk of disease spread. With its ability to integrate with other systems and easily share data, the Vaccination Management System is a powerful tool for improving vaccination coverage and protecting public health.</p>		\n			<figure><a href=\"http://systems.bayambang.gov.ph\"><img width=\"150\" height=\"150\" src=\"http://localhost/bbwebsite/wp-content/uploads/2023/01/ABSIconPNG-640w-150x150.png\" alt=\"\" loading=\"lazy\" /></a></figure><h5><a href=\"http://systems.bayambang.gov.ph\">Online Appointment System</a></h5><p>An online appointment system is a software tool that allows businesses to manage and schedule appointments with clients or customers through the internet. This system streamlines the process of making appointments, eliminates the need for phone calls and walk-ins, and improves efficiency and communication between the business and its clients. It also allows for easy rescheduling and cancellations, and provides reminders for upcoming appointments. Overall, an online appointment system improves the customer experience and increases the productivity and organization of the business.</p>', 'About Bayambang', '', 'inherit', 'closed', 'closed', '', '27-revision-v1', '', '', '2023-01-24 06:35:28', '2023-01-24 06:35:28', '', 27, 'http://localhost/bbwebsite/?p=168', 0, 'revision', '', 0),
