ary 24, 2023</time>\n    </article><article data-id=\"1\">\n            <header><h1><a\n                                    href=\"http://localhost/bbwebsite/2023/01/23/hello-world/\"\n                                    title=\"Hello world!\">Hello world!</a></h1></header>\n                                    <p>Welcome to WordPress. This is your first post. Edit or delete it,...</p><a\n                                        href=\"http://localhost/bbwebsite/2023/01/23/hello-world/\"\n                                       >Read More</a>\n                                <time datetime=\"January 23, 2023\">January 23, 2023</time>\n    </article>\n			<h3>Bayambang Online Systems</h3>		\n															<img width=\"300\" height=\"22\" src=\"http://localhost/bbwebsite/wp-content/uploads/2023/01/gold-divider-12-300x22.png\" alt=\"\" loading=\"lazy\" srcset=\"http://localhost/bbwebsite/wp-content/uploads/2023/01/gold-divider-12-300x22.png 300w, http://localhost/bbwebsite/wp-content/uploads/2023/01/gold-divider-12-1024x74.png 1024w, http://localhost/bbwebsite/wp-content/uploads/2023/01/gold-divider-12-768x55.png 768w, http://localhost/bbwebsite/wp-content/uploads/2023/01/gold-divider-12-1536x111.png 1536w, http://localhost/bbwebsite/wp-content/uploads/2023/01/gold-divider-12.png 2000w\" sizes=\"(max-width: 300px) 100vw, 300px\" />															\n			<style>/*! elementor - v3.10.1 - 17-01-2023 */\n.elementor-widget-image-box .elementor-image-box-content{width:100%}@media (min-width:768px){.elementor-widget-image-box.elementor-position-left .elementor-image-box-wrapper,.elementor-widget-image-box.elementor-position-right .elementor-image-box-wrapper{display:flex}.elementor-widget-image-box.elementor-position-right .elementor-image-box-wrapper{text-align:right;flex-direction:row-reverse}.elementor-widget-image-box.elementor-position-left .elementor-image-box-wrapper{text-align:left;flex-direction:row}.elementor-widget-image-box.elementor-position-top .elementor-image-box-img{margin:auto}.elementor-widget-image-box.elementor-vertical-align-top .elementor-image-box-wrapper{align-items:flex-start}.elementor-widget-image-box.elementor-vertical-align-middle .elementor-image-box-wrapper{align-items:center}.elementor-widget-image-box.elementor-vertical-align-bottom .elementor-image-box-wrapper{align-items:flex-end}}@media (max-width:767px){.elementor-widget-image-box .elementor-image-box-img{margin-left:auto!important;margin-right:auto!important;margin-bottom:15px}}.elementor-widget-image-box .elementor-image-box-img{display:inline-block}.elementor-widget-image-box .elementor-image-box-title a{color:inherit}.elementor-widget-image-box .elementor-image-box-wrapper{text-align:center}.elementor-widget-image-box .elementor-image-box-description{margin:0}</style><figure><a href=\"http://systems.bayambang.gov.ph\" target=\"_blank\" rel=\"noopener\"><img width=\"150\" height=\"150\" src=\"http://localhost/bbwebsite/wp-content/uploads/2023/01/pngwing.com-1-150x150.png\" alt=\"\" loading=\"lazy\" /></a></figure><h5><a href=\"http://systems.bayambang.gov.ph\" target=\"_blank\" rel=\"noopener\">Document Management System</a></h5><p>A document management system (DMS) is a software application that helps businesses organize, store, and track electronic documents and images. DMS typically includes features such as version control, metadata, security, and workflow. It allows users to easily search and retrieve documents, while also maintaining a secure and auditable record of all document activity. Additionally, many DMS systems now include collaboration features that allow multiple users to work on the same document at the same time. Implementing a DMS can help businesses improve efficiency and compliance, while also reducing costs associated with paper storage.</p>		\n			<figure><a href=\"https://systems.bayambang.gov.ph/vaccineregister?fbclid=IwAR1xpC1gDSLWB7GuRxpkwzAwlexX1HdQ8vdKx-JWRQpE9zEqqNGcUikjPXY\" target=\"_blank\" rel=\"noopener\"><img width=\"150\" height=\"150\" src=\"http://localhost/bbwebsite/wp-content/uploads/2023/01/15437169-e1674541644428-150x150.jpg\" alt=\"\" loading=\"lazy\" /></a></figure><h5><a href=\"https://systems.bayambang.gov.ph/vaccineregister?fbclid=IwAR1xpC1gDSLWB7GuRxpkwzAwlexX1HdQ8vdKx-JWRQpE9zEqqNGcUikjPXY\" target=\"_blank\" rel=\"noopener\">Vaccination Management System</a></h5><p>The Vaccination Management System is a cutting-edge solution designed to streamline the administration and tracking of vaccinations for individuals and groups. It utilizes a user-friendly interface that allows for easy data entry and access, as well as advanced features such as automated reminders and reporting capabilities. This system can be used by healthcare providers, schools, and other organizations to ensure that individuals are up-to-date on their vaccinations, reducing the risk of disease spread. With its ability to integrate with other systems and easily share data, the Vaccination Management System is a powerful tool for improving vaccination coverage and protecting public health.</p>		\n			<figure><a href=\"http://appoinment.bayambang.gov.ph\" target=\"_blank\" rel=\"noopener\"><img width=\"150\" height=\"150\" src=\"http://localhost/bbwebsite/wp-content/uploads/2023/01/ABSIconPNG-640w-150x150.png\" alt=\"\" loading=\"lazy\" /></a></figure><h5><a href=\"http://appoinment.bayambang.gov.ph\" target=\"_blank\" rel=\"noopener\">Online Appointment System</a></h5><p>An online appointment system is a software tool that allows businesses to manage and schedule appointments with clients or customers through the internet. This system streamlines the process of making appointments, eliminates the need for phone calls and walk-ins, and improves efficiency and communication between the business and its clients. It also allows for easy rescheduling and cancellations, and provides reminders for upcoming appointments. Overall, an online appointment system improves the customer experience and increases the productivity and organization of the business.</p>', 'About Bayambang', '', 'inherit', 'closed', 'closed', '', '27-revision-v1', '', '', '2023-04-24 06:00:52', '2023-04-24 06:00:52', '', 27, 'http://localhost/bbwebsite/?p=256', 0, 'revision', '', 0);
